sourcesContent:
console.log("hey")

window.onload = function(){
    alert('fuk')
    document.getElementsByClassName('checkbox').forEach(x => x.addEventListener('click',function(){
        console.log("re");
        getCheckedBox();
    })
    )
};
function getCheckedBox(){
    var checkedBoxes = document.getElementsByClassName('checkbox');
    console.log(checkedBoxes)
}
